R["oh__@uofmmike2000"]="{['TS']=1636834624,['Key']='oh__@uofmmike2000',['na']={[59]={['O']=18903,['D']='',['C']=1.021000,['N']='Alinor House',},[89]={['O']=18944,['D']='War has come to Blackwood!!  The Aldmeri Guild \\'The Havoc Squad\\' has returned to the Hounds of War Cathedral to prepare for the Invasion.  ALL of Blackwood will be destroyed if they allow the Daggerfall Covenant or the EbonHeart Pact to get through the ONLY Fort standing in their way.  \"CRY HAVOC and let live the Dogs of War\"',['C']=1.017000,['N']='Blackwood Chapel',},[49]={['O']=18936,['D']='',['C']=1.038000,['N']='Witches Cottage',},[79]={['O']=18915,['D']='Castle Ravenloft.  Home to Count Strahd Von Zarovich, the Demiplane Master.   His love for Tatyana pushed him to pursue her to Tamriel, and to begin his conquering of the underdark here in Blackreach.  \" I am the Ancient, I am the Land. My beginnings are lost in the darkness of the past. I am not dead. Nor am I alive. I am undead, forever.\"  - Tome of Strahd. ',['C']=1.048000,['N']='Castle Ravenloft',},},['Version']=1766,}"
