R["oh__@ah'satan"]="{['TS']=1636763294,['na']={[86]={['O']=18944,['D']='The massive Technomancy Airship \"Rocinate\" sits at dock along the Gold Coast. This majestic vessel is held aloft using magiks, technomancy, expert engineering & repurposed Dwemer artifacts. Majestically floating above ancient ruins, the vessel contains multiple levels & rooms: inlcuding bridge, staging area, barracks, mess hall, meeting halls & more. Ready for battle it is large enough to house dozens of troops & personel while boasting massive protective cannons & 2 technomantic aircraft.',['C']=1.015000,['N']='TECHNOMANCY CARRIER',},[89]={['O']=18922,['D']='School of Witchcraft and Wizardry',['C']=1.007000,['N']='HOGWARTS SCHOOL',},[62]={['O']=18922,['D']='HOGWARTS',['C']=1.007000,['N']='HOGWARTS',},[15]={['O']=18913,['D']='The Inn of the Last Home -- A treetop Inn in the Heart of a Valenwood forest, the massive tree wrapped around by the inns natural wood bar carved from the branches of the valenwood and a place for weary travelers before entering the wilder country along the roads',['C']=1.007000,['N']='INN OF THE LAST HOME',},},['Key']='oh__@ah\\'satan',['Version']=1766,}"
