R["oh__@zihong"]="{['Version']=1765,['na']={[88]={['N']='Artisan\\'s Guild',['O']=18924,['C']=1.046000,['D']='Artisan\\'s Guild that has 4 workshops, a community area, a dorm room, and balcony seating area. ',},[33]={['N']='Mountain Bazzar',['O']=18869,['C']=1.021000,['D']='One of my favorite places to visit is an exoticc bazzar, so I made one. It features many different shops, a couple gardens, and a eatery. Tell me what you think!',},[83]={['N']='Markarth Manor',['O']=18869,['C']=1.050000,['D']='The inspiration for this house is cave hotels. it features a lobby, a guest room, a restuarant, a bar, an outside BBQ area, a theater, and a dessert shop. You are welcome to come and stay! ',},[61]={['N']='Time, Space',['O']=18869,['C']=1.020000,['D']='If I could travel in time as I travel in space, I would wake up in my humble village, travel to an ancient castle for lunch, and take a space shuttle to the future for a night out. This home features a village, a castle, and a space port. It is my fantasy. Would you bring your magic and accompany me?',},[25]={['N']='Shady Sanctuary',['O']=18869,['C']=1.021000,['D']='This is my hiding place. I wonder if I had to live in just one house for the rest of my life, what would it look like? I have to have a tree house, a nice garden, and a water feature. Would you agree?',},[89]={['N']='The Fishing Village',['O']=18894,['C']=1.018000,['D']='Hiya! I visited the Tai Ou village in Hong Kong and forever fallen in love with fishing villages. So I created one with all the best things of a fishing village I would visit. Enjoy!',},},['TS']=1635098073,['Key']='oh__@zihong',}"
