R["oh__@the-cawckiest.king"]="{['TS']=1635068484,['na']={[83]={['N']='Nocturnal Temple',['O']=18917,['C']=1.007000,['D']='There are few places in Tamriel that welcome a temple to one of the Daedric Princes, or the Great Spirits, as Reachfolk know them; a unique opportunity only Markarth can provide. Opened in 2E 589 by the Kråke Clan, following the events of the Gray Host, and a war with a Malacath Orc cult, the Nozarga. The Temple is for those who revere the Night Mistress and Patron of Thieves, Nocturnal, to do so openly, as well as a place to share drinks and meet others who work in the shadows comfortably.',},[71]={['N']='Wolf\\'s Fall',['O']=18924,['C']=1.007000,['D']='A dangerous stretch of forest, swamp, and mountains in the Hunting Grounds used by followers of Hircine wanting to test themselves and their capabilities... or die trying.',},},['Version']=1762,['Key']='oh__@the-cawckiest.king',}"
