R["oh__@xaraan"]="{['TS']=1632107745,['na']={[34]={['O']=18874,['N']='The Oasis',['D']='Small safehouse in Bangkorai, simple yet well adorned for a relaxing escape from adventures.',['C']=1.051000,},[68]={['O']=18874,['N']='Selene\\'s Apartment',['D']='Though she seems to find her way into all my homes, Selene still needed her own private getaway in her homeland to have a few drinks and relax.  So this simple apartment was created for her to have her own little kingdom of pillows and wine.',['C']=1.051000,},[70]={['O']=18874,['N']='Khunzar-ri\\'s Rest',['D']='Xaraan-do welcomes you to Khunzar-ri\\'s Rest.  The entry hall has been equipped with a living and work area to aid with your adventuring needs.  Enter the portal to pay your respects to the great Khunar-ri, or enjoy a tour of the trophies and treasures we have collected in our adventures.  Or if you simply want a quiet place to relax, climb the stairs to the platform high above his shrine and enjoy one of the best views in Tamriel.',['C']=1.011000,},[8]={['O']=18874,['N']='Magehome',['D']='The sorcerer Xa\\'Raan, often annoyed with the other wizards of the mages guild, bought and converted this small home into his own private study and escape when he needs time to himself.  ',['C']=1.025000,},[42]={['O']=18874,['C']=1.049000,['D']='Hey, it\\'s an apartment.',['N']='Vivec City Inn',},[11]={['O']=18874,['C']=1.020000,['D']='Intrigued by the necromancy of Z\\'Maja after battling her in Cloudrest, the argonian necromancer Xaraan-Vahat began studying the sload\\'s shadow magic here in secret in hopes of expanding his own powers.  Set up with the bare minimum for actually living in, this home is used almost solely for research.  And despite all his attempts to keep his studies private, some of the shadow magic has begun to creep out of the home and infect the plantlife around it.',['N']='Abyssal Analysis',},[44]={['O']=18874,['N']='Morrowind Outpost',['D']='A little \\'air b&b\\' in Morrowind.  Library upstairs, living on main floor with small entertaining area for guests.  Small raised patio outside overlooking the coast.',['C']=1.051000,},[13]={['O']=18874,['N']='Undaunted Outpost',['D']='Just a simple small guild workshop at a convenient location in Grahtwood.',['C']=1.010000,},[78]={['O']=18874,['N']='Proudhome',['D']='Just a \\'simple\\' home.  Kitchen, dining and smoking den on the main floor with a private patio when the weather is worth enjoying up north.  The basement contains the work area and treasure room and the top floor the library and bedroom.  Antiquities featured throughout.',['C']=1.051000,},[15]={['O']=18874,['N']='Spriggan\\'s Grotto',['D']='Though the spriggan guardian Xa\\'rana is often traveling to protect all of Tamriel from corrupting forces, she could not avoid creating her own little protected grotto to cultivate nature.  Enjoy your time here, respect and reconnect with nature.',['C']=1.021000,},[49]={['O']=18874,['N']='The Hag\\'s Hut',['D']='Home of the vampiric-necromancer witch Xaraana, she is careful not to draw too much attention with her work from the nobles of Glenumbra, but guests don\\'t always escape once they enter should they come upon her while she is home.',['C']=1.023000,},[23]={['O']=18874,['N']='Guildie Refuge',['D']='Called a mini-guild hall by us, I tried to create a small outpost for quick port to anything outside of specific named crafting stations one might need.  All crafting stations are organized near port-in (outside) with quick access.  Raid training dummy kept in house for private area to practice so visitors entering and leaving won\\'t disturb your practice.  A well-lit outfit station, banker, merchants, thief merchant, transmute station, and resource well all near port in as well. ',['C']=1.010000,},[88]={['O']=18860,['C']=1.051000,['D']='Divided home into work/rest.  Port in side of home is designed for stations, storage, etc.  Other side of home is living areas.',['N']='Leyawiin Bridge Home',},[25]={['O']=18874,['C']=1.049000,['D']='A thieves guild safehouse sponsored by Xaraan-dar and nestled on the border between Reaper\\'s March and Malabal Tor.  A seperate fencing area sits beside the home for smuggling goods, with a guild-member overlooking the transactions from her perch.  The home can be used by those needing to lay low for a few days.',['N']='Noweyr',},[26]={['O']=18874,['N']='The Library',['D']='Unless you enjoy reading, you won\\'t find much of interest here as most of the home (and build space) focuses solely around lore books.  If you do enjoy reading, then feel free to visit to read the collected lore books of Tamriel all collected and shelved here for easy study.',['C']=1.025000,},[30]={['O']=18874,['N']='The Retreat',['D']='A tree-covered courtyard leads left to a workshop or right to a small sitting area and shrine.  The home is set up mostly for entertaining, with a large dining and sitting area downstairs and libarary upstairs with bedroom.',['C']=1.051000,},[58]={['O']=18886,['C']=1.025000,['D']='Just a simple private study tucked away in Alinor.',['N']='Alinor Study',},[62]={['O']=18874,['N']='The Memorial',['D']='This small cave has been converted into a memorial for fellow players we have lost in real life.  Though we all may have a different list of names that could adorn the memorial, this place serves as a quiet, private spot to remember them all.  Even online and at great distances, these friendships can have a huge impact on us.  Thank you for being part of our lives friends.',['C']=1.029000,},[2]={['O']=18890,['C']=1.051000,['D']='Simple apartment.',['N']='Daggerfall Inn',},},['Key']='oh__@xaraan',['Version']=1762,}"
